import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  const links = [
    { name: "Home", bg: "bg-white", hover: "hover:bg-gray-200", text: "text-red-500" },
    { name: "Cart", bg: "bg-white", hover: "hover:bg-gray-200", text: "text-red-500" },
    { name: "Custom Pizza", bg: "bg-white", hover: "hover:bg-gray-200", text: "text-red-500" },
    { name: "Login", bg: "bg-yellow-400", hover: "hover:bg-yellow-300", text: "text-black" },
    { name: "Register", bg: "bg-yellow-400", hover: "hover:bg-yellow-300", text: "text-black" },
  ];

  return (
    <nav className="bg-red-500 px-6 py-4 shadow-md flex justify-between items-center flex-nowrap">
      {/* Logo */}
      <Link to="/" className="text-white text-2xl font-bold">
        üçï Pizza Delivery
      </Link>

      {/* Links */}
      <div className="flex items-center" style={{ gap: "6px" }}>
        {links.map((link) => (
          <Link
            key={link.name}
            to={`/${link.name.toLowerCase().replace(" ", "-")}`}
            className={`text-lg font-semibold px-6 py-3 rounded-md ${link.bg} ${link.text} ${link.hover} border border-gray-300 shadow-sm transition cursor-pointer`}
          >
            {link.name}
          </Link>
        ))}
      </div>
    </nav>
  );
};

export default Navbar;
